body { height: 50px; width: 50px; }
* { font-family: arial; }
div { height: 100%; }
.hoverContainer { height: 320px; width: 520px; }
iframe { position: absolute; top: 0; left: 0; right: 0; height: 100%; border: none; }
.hoverContainer {
    background: black;
    border-radius: 28px;
    padding: 18px;
    display: flex;
    flex-direction: column;
    position: relative;
    margin-bottom: 12px;
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);
}
.header_discrip { font-size: 21px; font-weight: 300; color: #6f6f6f; width: fit-content; }
.header {
    padding-bottom: 12px;
    width: 100%;
    height: 36px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: row;
}

* {
    font-family: Arial;
  }


  .startPage {
    position: absolute;
    width:auto;
    z-index: 0;
    transition: transform 0.3s ease;
  }

  .startPage:hover {
    transform: translateY(-1%);
  }

  .hoverContainer {
    background: black;
    border-radius: 27px;
    padding: 18px;
display: flex;
flex-direction: row;
    margin: 12px auto;
    position: relative;
  }

  .header {
    padding-bottom: 12px;
    margin-bottom: 12px;
    border-bottom: 1px solid #3e3e3e;
    width: 100%;
    height: 36px;
    display: flex;
    align-items: center;
    justify-content: space-between;
  }

  .header_discrip {
    font-size: 21px;
    font-weight: 200;
    color: #6f6f6f;
  }

  .size-smallButton {
    font-size: 21px;
    border-radius: 12px;
    height: 48px;
    min-width: 48px;
    display: flex;
    align-items: center;
    justify-content: center;
    width: 100%;
    cursor: pointer;
  }

  .style-input {
    background: #2a2a2b;
    padding: 12px;
    transition: background 0.3s;
  }

  .style-input:hover {
    background: #3b3b3c;
  }
a:not(:first-child) {
      margin-left:8px;}
  a {
    color: #b6b6b7;
  }

  a:hover,
  a:hover .header_discrip {
    color: #dddddd !important;
  }
